  false,\n\t\"url\": null,\n\t\"notes\": \"Water quality data from were collected
  by the Monitoring Section of the State of Hawaii, Department of Health. Data were
  obtained from 373 state-wide coastal stations employing well-established instruments
  and methodologies. This dataset spans 1973-1998. Parameters include temperature,
  salinity, conductivity, dissolved oxygen, percent saturation of oxygen, pH, turbidity,
  total suspended solids, total nitrogen, dissolved ammonia nitrogen, nitrate and
  nitrite nitrogen total phosphate, total dissolved phosphorus, ortho-phosphate phosphorus,
  chlorophyll-a, silicate, Secchi disk depth, Oxidation-Reduction Potential, and concentration
  of fecal coliforms. Data are in a comma separated value (.csv) format.\",\n\t\"owner_org\":
